import React from "react";
import SkillChart from "../Components/SkillsChart" 
import FlipCard from '../Components/FlipCard'
import {Bar, Doughnut, Polar, Radar, HorizontalBar} from 'react-chartjs-2';
function SkillPage(props) {
    var dataPL = {
        datasets: [{
            data: [40,30,20,10],
            backgroundColor: ['Red','Yellow','Purple','Green'],
            borderColor:['transparent','transparent','transparent','transparent']
        }],
    
       
        labels: [
            'Python',
            'Bash',
            'Java',
            'C'
        ],
        frontTitle: 'Programming \n Languages',
        options: 
            {legend: 
                {display: true, position: "bottom", labels:
                    {
                        fontColor:'#FFFFFF'
                    }
                }
            }
        }

        let skills = [
            {
              "type": "Python",
              "level": 100,
              "color": {
                "bar": "#8B0000",
                "title": {
                  "text": "#fefefe",
                  "background": "#DC143C"
                }
              }
            },
            {
              "type": "Java",
              "level": 85,
              "color": {
                "bar": "#4288d0",
                "title": {
                  "text": "#fff",
                  "background": "#900C3F"
                }
              }
            },
            {
              "type": "Javascript",
              "level": 75,
              "color": {
                "bar": "#2c3e50",
                "title": {
                  "text": "#fff",
                  "background": "#2c3e50"
                }
              }
            },
            {
              "type": "Spring",
              "level": 50,
              "color": {
                "bar": "#5a68a5",
                "title": {
                  "text": "#fff",
                  "background": "#46465e"
                }
              }
            },
            {
              "type": "Docker",
              "level": 25,
              "color": {
                "bar": "#525252",
                "title": {
                  "text": "#fff",
                  "background": "#333333"
                }
              }
            },
            {
              "type": "HTML",
              "level": 20,
              "color": {
                "bar": "black",
                "title": {
                  "text": "#111",
                  "background": "#fff"
                }
              }
            },
            {
              "type": "NoSQL",
              "level": 0,
              "color": {
                "bar": "#2ecc71",
                "title": {
                  "text": "#fff",
                  "background": "#27ae60"
                }
              }
            }
          ]              
        var dataML = {
            datasets: [{
                data: [40,30,20,10],
                backgroundColor: ['Red','Yellow','Purple','Green'],
            }],
        
           
            labels: [
                'NLP',
                'RecommenderSystems',
                'pytorch',
                ''
            ],
            frontTitle: 'Machine Learning',
            options: 
                {legend: 
                    {display: true, position: "bottom", labels:
                        {
                            fontColor:'#FFFFFF'
                        }
                    }
                }
            }
    
    var softSkillsChartData = {
        labels: ['Public Speaking', 'Swimming','Weightlifting','Reading', 'Coding', 'Table Tennis', 'DJing'],
        datasets: [
          {
            label: 'Hobbies',
            backgroundColor: 'rgba(179,181,198,0.2)',
            borderColor: 'rgba(179,181,198,1)',
            pointBackgroundColor: 'rgba(179,181,198,1)',
            pointBorderColor: '#fff',
            pointHoverBackgroundColor: '#fff',
            pointHoverBorderColor: 'rgba(179,181,198,1)',
            data: [65, 59, 90, 81, 56, 55, 40]
          },
          {
            label: 'Professional',
            backgroundColor: 'rgba(255,99,132,0.2)',
            borderColor: 'rgba(255,99,132,1)',
            pointBackgroundColor: 'rgba(255,99,132,1)',
            pointBorderColor: '#fff',
            pointHoverBackgroundColor: '#fff',
            pointHoverBorderColor: 'rgba(255,99,132,1)',
            data: [28, 48, 40, 19, 96, 27, 100]
          }
        ],
        frontTitle1: 'Soft',
        frontTitle2: 'Skills'
      };

      var webDevData = {
        datasets: [{
            data: [40,30,20,10],
            backgroundColor: ['Red','Yellow','Purple','Green'],
        }],
    
       
        labels: [
            'Python',
            'Bash',
            'Java',
            'C'
        ],
        frontTitle: 'WebDev',
        options: 
            {legend: 
                {display: true, position: "bottom", labels:
                    {
                        fontColor:'#FFFFFF'
                    }
                }
            }
        }

    var devOpsData = {
            datasets: [{
                data: [40,30,20,10],
                backgroundColor: ['Red','Yellow','Purple','Green'],
            }],
        
           
            labels: [
                'Python',
                'Bash',
                'Java',
                'C'
            ],
            frontTitle: 'DevOps',
            options: 
                {legend: 
                    {display: true, position: "bottom", labels:
                        {
                            fontColor:'#FFFFFF'
                        }
                    }
                }
            }

    return  (
        <div>
            <SkillChart
             chartDataPL = {skills}
             chartDataML = {dataML}
             softSkillsChartData = {softSkillsChartData}
             webDevChartData = {webDevData}
             devOpsChartData = {devOpsData}
            />
        </div>

    )
}

export default SkillPage
